import React, { Component, Fragment } from 'react';
import './Home.css'

const Home = function () {
    return <Fragment>
        <section id="home">
            <div id="perfil-image-container">
                <div id="perfil-image">
                </div>
            </div>
            <div id="perfil-data">
                Ois
            </div>
        </section>
    </Fragment>;
}

export default Home;
